function EventEmitter(){this.element=document.createElement("div")}EventEmitter.prototype.emit=function(t,e){this.element.dispatchEvent(new CustomEvent(t,{detail:e}))},EventEmitter.prototype.addEventListener=function(t,e){this.element.addEventListener(t,e,!1)},EventEmitter.prototype.removeEventListener=function(t,e){this.element.removeEventListener(t,e,!1)},EventEmitter.prototype.on=EventEmitter.prototype.addEventListener,EventEmitter.prototype.off=EventEmitter.prototype.removeEventListener;